INSERT INTO `COMMUNITY_PAGES` VALUES (60, 'New Delhi', '', 'CITY', 'DE00', 1, '/matrimonials/delhi-matrimonials/', 'Y', 'L1_CI_60', 'Marriages in Delhi are a grand and festive affair where the groom and the bride wear beautiful attires and look at their best. Delhites usually prefer to wed their sons/daughters within the city of within the NCR region. The marriages take place within the community and numerous guests are invited.  Most of the life partners are found with the help of matrimonial sites and through relatives.  Delhi is a cosmopolitan city and one can experience various kinds of marriages and their unique rituals.', 'Delhi Matrimony - Delhi Matrimonial - Delhi Matrimonials - Delhi Marriage - Online Delhi Matrimonials - Matrimonial Services', 'Search Delhi Matrimony, Delhi Matrimonial, Delhi Matrimonials, Delhi Marriage, Delhi Matrimonial Profiles in the leading Delhi Matrimonials site for Indian and NRI Delhi Marriage. Join Free &amp; Add your Delhi Matrimonial Profile Now! Find suitable Indian &amp; NRI Delhi brides and grooms from our online Delhi matrimonial and matchmaking services.', 'Delhi matrimony, Delhi matrimonials, Delhi matrimonial, matrimonials, matrimony, matrimony services, online Delhi matrimonials, Indian marriage, match making, matchmaker, Delhi profiles, marriage bureau , Delhi marriage bureau, matchmaking services, matrimonial profiles, Delhi bride, Delhi groom, matrimony classified, brides, grooms', 'Delhi Matrimonials', 'Y', 'delhi-matrimonials.jpg', 'Delhi Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (61, 'Mumbai', '', 'CITY', 'MH04', 1, '/matrimonials/mumbai-matrimonial/', 'Y', 'L1_CI_61', 'Weddings in the stylish city of Mumbai have become the epitome of flamboyance and wonder. Located on the coast of Arabian Sea, it hosts lakhs of weddings every year uniting couples into an eternal bond. As known worldwide, Indian marriages are a glitzy affair with a lot of money and hoopla involved. Matrimonial celebrations are immensely enriched with cultural and traditional rituals making it a week long event. This largest metro of the country revels in the institution of marriage at its best.', 'Mumbai Matrimony - Mumbai Matrimonial - Mumbai Matrimonials -Mumbai Marriage - Online Mumbai Matrimonials - Matrimonial Services', 'Search Mumbai Matrimony, Mumbai Matrimonial, Mumbai Matrimonials, Mumbai Marriage, Mumbai Matrimonial Profiles in the leading Mumbai Matrimonials site for Indian and NRI Mumbai Marriage. Join Free &amp; Add your Mumbai Matrimonial Profile Now! Find suitable Indian &amp; NRI Mumbai brides and grooms from our online Mumbai matrimonial and matchmaking services.', 'Mumbai matrimony, Mumbai matrimonials, Mumbai matrimonial, matrimonials, matrimony, matrimony services, online Mumbai matrimonials, Indian marriage, match making, matchmaker, Mumbai profiles, marriage bureau , Mumbai marriage bureau, matchmaking services, matrimonial profiles, Mumbai bride, Mumbai groom, matrimony classified, brides, grooms', 'Mumbai Matrimonials', 'Y', 'mumbai-matrimonials.jpg', 'Mumbai Matrimony');
