INSERT INTO `COMMUNITY_PAGES` VALUES (63, 'Pune', '', 'CITY', 'MH08', 1, '/matrimonials/pune-matrimonial/', 'Y', 'L1_CI_63', 'Pune is the city famous for its education institutes and IT parks. The city mainly inhabits Marathi people but due various opportunities people from different cities have migrated here. Marathi weddings are celebrated in Pune with lot of simplicity and customs. The Marathi bride and groom dress themselves in traditional clothes where the bride wears a green color saree and the groom wears kurta along with dhoti. Inter-caste marriages are widely practiced due to matching compatibility in Pune.', 'Pune Matrimony - Pune Matrimonial - Pune Matrimonials -Pune Marriage - Online Pune Matrimonials - Matrimonial Services', 'Search Pune Matrimony, Pune Matrimonial, Pune Matrimonials, Pune Marriage, Pune Matrimonial Profiles in the leading Pune Matrimonials site for Indian and NRI Pune Marriage. Join Free &amp; Add your Pune Matrimonial Profile Now! Find suitable Indian &amp; NRI Pune brides and grooms from our online Pune matrimonial and matchmaking services.', 'Pune matrimony, Pune matrimonials, Pune matrimonial, matrimonials, matrimony, matrimony services, online Pune matrimonials, Indian marriage, match making, matchmaker, Pune profiles, marriage bureau , Pune marriage bureau, matchmaking services, matrimonial profiles, Pune bride, Pune groom, matrimony classified, brides, grooms', 'Pune Matrimonials', 'Y', 'pune-matrimonials.jpg', 'Pune Matrimony');
