INSERT INTO `COMMUNITY_PAGES` VALUES (74, 'Noida', '', 'CITY', 'UP25', 1, '/noida-matrimony-matrimonials', 'Y', 'L1_CI_74', 'Noida, situated few kilo metres away from the Yamuna is a part of UP. It is one of the major business centres among Delhiâ€™s NCRs. Noida like Delhi has a mix of people, hailing from all walks of life. The cultures and the rituals of the people living in Noida is not confined to a single religion or caste. Thus, the marriage rituals and choices vary according to the person and his family background. The choice for marriage match is also subjective to the upbringing and the religion of the person. ', 'Noida Matrimony - Noida Matrimonial - Noida Matrimonials -Noida Marriage - Online Noida Matrimonials - Matrimonial Services', 'Search Noida Matrimony, Noida Matrimonial, Noida Matrimonials, Noida Marriage, Noida Matrimonial Profiles in the leading Noida Matrimonials site for Indian and NRI Noida Marriage. Join Free &amp; Add your Noida Matrimonial Profile Now! Find suitable Indian &amp; NRI Noida brides and grooms from our online Noida matrimonial and matchmaking services.', 'Noida matrimony, Noida matrimonials, Noida matrimonial, matrimonials, matrimony, matrimony services, online Noida matrimonials, Indian marriage, match making, matchmaker, Noida profiles, marriage bureau , Noida marriage bureau, matchmaking services, matrimonial profiles, Noida bride, Noida groom, matrimony classified, brides, grooms', 'Noida Matrimonials', 'Y', 'noida-matrimonials.jpg', 'Noida Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (75, 'Indore', '', 'CITY', 'MP08', 1, '/indore-matrimony-matrimonials', 'Y', 'L1_CI_75', 'Indore is a commercial capital of Madhya Pradesh and comprised of educated people. The city has many reputed educational institutes and is developing with the improvement of infrastructure. The people in Indore are very humble and soft spoken and conduct marriages with simplicity. The marriage decisions are taken by the parents of the prospective bride and groom. The marriages are conducted within the community and inter-caste weddings are usually not accepted by the society of Indore. ', 'Indore Matrimony - Indore Matrimonial - Indore Matrimonials -Indore Marriage - Online Indore Matrimonials - Matrimonial Services', 'Search Indore Matrimony, Indore Matrimonial, Indore Matrimonials, Indore Marriage, Indore Matrimonial Profiles in the leading Indore Matrimonials site for Indian and NRI Indore Marriage. Join Free &amp; Add your Indore Matrimonial Profile Now! Find suitable Indian &amp; NRI Indore brides and grooms from our online Indore matrimonial and matchmaking services.', 'Indore matrimony, Indore matrimonials, Indore matrimonial, matrimonials, matrimony, matrimony services, online Indore matrimonials, Indian marriage, match making, matchmaker, Indore profiles, marriage bureau , Indore marriage bureau, matchmaking services, matrimonial profiles, Indore bride, Indore groom, matrimony classified, brides, grooms', 'Indore Matrimonials', 'Y', 'indore-matrimonials.jpg', 'Indore Matrimony');
