INSERT INTO `COMMUNITY_PAGES` VALUES (77, 'Bhubaneshwar', '', 'CITY', 'OR01', 1, '/bhubaneshwar-matrimony-matrimonials', 'Y', 'L1_CI_77', 'Bhubaneshwar, the capital of Orissa, is the economic and religious centre of the city. Due to the presence of large number of temples in the city, Bhubaneshwar, is also known as the city of temples. Hinduism and Islam are two min religions, which are followed by the people of Bhubneshwar. Majority of people are involved in tech and real estate industry. Therefore, while looking for a marriage match, people of Bhubaneshwar, prefer a life partner from the same education and religious background. ', 'Bhubaneshwar Matrimony - Bhubaneshwar Matrimonial - Bhubaneshwar Matrimonials -Bhubaneshwar Marriage - Online Bhubaneshwar Matrimonials - Matrimonial Services', 'Search Bhubaneshwar Matrimony, Bhubaneshwar Matrimonial, Bhubaneshwar Matrimonials, Bhubaneshwar Marriage, Bhubaneshwar Matrimonial Profiles in the leading Bhubaneshwar Matrimonials site for Indian and NRI Bhubaneshwar Marriage. Join Free &amp; Add your Bhubaneshwar Matrimonial Profile Now! Find suitable Indian &amp; NRI Bhubaneshwar brides and grooms from our online Bhubaneshwar matrimonial and matchmaking services.', 'Bhubaneshwar matrimony, Bhubaneshwar matrimonials, Bhubaneshwar matrimonial, matrimonials, matrimony, matrimony services, online Bhubaneshwar matrimonials, Indian marriage, match making, matchmaker, Bhubaneshwar profiles, marriage bureau , Bhubaneshwar marriage bureau, matchmaking services, matrimonial profiles, Bhubaneshwar bride, Bhubaneshwar groom, matrimony classified, brides, grooms', 'Bhubaneshwar Matrimonials', 'Y', 'bhubaneshwar-matrimonials.jpg', 'Bhubaneshwar Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (78, 'Ghaziabad', '', 'CITY', 'UP12', 1, '/ghaziabad-matrimony-matrimonials', 'Y', 'L1_CI_78', 'Ghaziabad is a planned industrial city in Indian state of Uttar Pradesh. It is a part of National Capital Region and is 19Km away from Delhi. Ghaziabad is mainly comprised of Hindus with significant population of Muslims as well. Many corporate companies are setting-up their office here which has resulted into more influx of population and establishment of infrastructure. Arranged marriage is the most prevalent option practiced between the girl and the boy in the region fixed by their parents. ', 'Ghaziabad Matrimony - Ghaziabad Matrimonial - Ghaziabad Matrimonials -Ghaziabad Marriage - Online Ghaziabad Matrimonials - Matrimonial Services', 'Search Ghaziabad Matrimony, Ghaziabad Matrimonial, Ghaziabad Matrimonials, Ghaziabad Marriage, Ghaziabad Matrimonial Profiles in the leading Ghaziabad Matrimonials site for Indian and NRI Ghaziabad Marriage. Join Free &amp; Add your Ghaziabad Matrimonial Profile Now! Find suitable Indian &amp; NRI Ghaziabad brides and grooms from our online Ghaziabad matrimonial and matchmaking services.', 'Ghaziabad matrimony, Ghaziabad matrimonials, Ghaziabad matrimonial, matrimonials, matrimony, matrimony services, online Ghaziabad matrimonials, Indian marriage, match making, matchmaker, Ghaziabad profiles, marriage bureau , Ghaziabad marriage bureau, matchmaking services, matrimonial profiles, Ghaziabad bride, Ghaziabad groom, matrimony classified, brides, grooms', 'Ghaziabad Matrimonials', 'Y', 'ghaziabad-matrimonials.jpg', 'Ghaziabad Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (79, 'Kanpur', '', 'CITY', 'UP18', 1, '/kanpur-matrimony-matrimonials', 'Y', 'L1_CI_79', 'Kanpur, one of the oldest townships of North India, ranks among the top 10 industrial cities in India. It is the largest city in the state of Uttar Pradesh and tenth most populous in the country. The main languages spoken in and around Kanpur include Hindi, English, Urdu, Bengali and Punjabi. Hinduism is the most prominent religion in the city and there are a considerable number of Muslims, Sikhs and Christians as well. Youngsters prefer arranged marriages and keep their families well involved.', 'Kanpur Matrimony - Kanpur Matrimonial - Kanpur Matrimonials -Kanpur Marriage - Online Kanpur Matrimonials - Matrimonial Services', 'Search Kanpur Matrimony, Kanpur Matrimonial, Kanpur Matrimonials, Kanpur Marriage, Kanpur Matrimonial Profiles in the leading Kanpur Matrimonials site for Indian and NRI Kanpur Marriage. Join Free &amp; Add your Kanpur Matrimonial Profile Now! Find suitable Indian &amp; NRI Kanpur brides and grooms from our online Kanpur matrimonial and matchmaking services.', 'Kanpur matrimony, Kanpur matrimonials, Kanpur matrimonial, matrimonials, matrimony, matrimony services, online Kanpur matrimonials, Indian marriage, match making, matchmaker, Kanpur profiles, marriage bureau , Kanpur marriage bureau, matchmaking services, matrimonial profiles, Kanpur bride, Kanpur groom, matrimony classified, brides, grooms', 'Kanpur Matrimonials', 'Y', 'kanpur-matrimonials.jpg', 'Kanpur Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (80, 'Faridabad', '', 'CITY', 'HA02', 1, '/faridabad-matrimony-matrimonials', 'Y', 'L1_CI_80', 'Faridabad, the most populated city of Haryana, is located just few KMs away from the national capital of India. Henna production and industries of products like tractors, motorcycles, refrigerators, tyres and shoes are the fields, in which most of the Faridabad people are employed. The ideology of the people of faridabad is highly influenced by the capital city. Preferences for marriage partner are subjective and depend mainly on the religious, family and the education background of the person.  ', 'Faridabad Matrimony - Faridabad Matrimonial - Faridabad Matrimonials -Faridabad Marriage - Online Faridabad Matrimonials - Matrimonial Services', 'Search Faridabad Matrimony, Faridabad Matrimonial, Faridabad Matrimonials, Faridabad Marriage, Faridabad Matrimonial Profiles in the leading Faridabad Matrimonials site for Indian and NRI Faridabad Marriage. Join Free &amp; Add your Faridabad Matrimonial Profile Now! Find suitable Indian &amp; NRI Faridabad brides and grooms from our online Faridabad matrimonial and matchmaking services.', 'Faridabad matrimony, Faridabad matrimonials, Faridabad matrimonial, matrimonials, matrimony, matrimony services, online Faridabad matrimonials, Indian marriage, match making, matchmaker, Faridabad profiles, marriage bureau , Faridabad marriage bureau, matchmaking services, matrimonial profiles, Faridabad bride, Faridabad groom, matrimony classified, brides, grooms', 'Faridabad Matrimonials', 'Y', 'faridabad-matrimonials.jpg', 'Faridabad Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (81, 'Ludhiana', '', 'CITY', 'PU07', 1, '/ludhiana-matrimony-matrimonials', 'Y', 'L1_CI_81', 'Ludhiana is the largest city in the Indian state of Punjab. The official language of Ludhiana is Punjabi and people of various castes live here. Punjabi is the dominant population that is famous for its extravagant and flamboyant marriages. Punjabiâ€™s are known for their â€˜live in the momentâ€™ approach and are most open minded people in India. The marriages are comprised of many rituals that are performed by the prospective bride and groom with lot of celebrations attended by close relatives.', 'Ludhiana Matrimony - Ludhiana Matrimonial - Ludhiana Matrimonials -Ludhiana Marriage - Online Ludhiana Matrimonials - Matrimonial Services', 'Search Ludhiana Matrimony, Ludhiana Matrimonial, Ludhiana Matrimonials, Ludhiana Marriage, Ludhiana Matrimonial Profiles in the leading Ludhiana Matrimonials site for Indian and NRI Ludhiana Marriage. Join Free &amp; Add your Ludhiana Matrimonial Profile Now! Find suitable Indian &amp; NRI Ludhiana brides and grooms from our online Ludhiana matrimonial and matchmaking services.', 'Ludhiana matrimony, Ludhiana matrimonials, Ludhiana matrimonial, matrimonials, matrimony, matrimony services, online Ludhiana matrimonials, Indian marriage, match making, matchmaker, Ludhiana profiles, marriage bureau , Ludhiana marriage bureau, matchmaking services, matrimonial profiles, Ludhiana bride, Ludhiana groom, matrimony classified, brides, grooms', 'Ludhiana Matrimonials', 'Y', 'ludhiana-matrimonials.jpg', 'Ludhiana Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (82, 'Thane', '', 'CITY', 'MH12', 1, '/thane-matrimony-matrimonials', 'Y', 'L1_CI_82', 'Thane, the metropolitan region of Mumbai, is a part of Maharashtra, located in the western part of India. The city has a number of lakes, which adds to its beauty and most of the people of Thane follow the Maharashtrian culture. Because of its neighbouring city Mumbai, the people of thane have a cosmopolitan approach towards life. . Other than Marathi marriages, all other marriage forms can be seen being practised by the people of Thane, because it has citizens from all parts of the country. ', 'Thane Matrimony - Thane Matrimonial - Thane Matrimonials -Thane Marriage - Online Thane Matrimonials - Matrimonial Services', 'Search Thane Matrimony, Thane Matrimonial, Thane Matrimonials, Thane Marriage, Thane Matrimonial Profiles in the leading Thane Matrimonials site for Indian and NRI Thane Marriage. Join Free &amp; Add your Thane Matrimonial Profile Now! Find suitable Indian &amp; NRI Thane brides and grooms from our online Thane matrimonial and matchmaking services.', 'Thane matrimony, Thane matrimonials, Thane matrimonial, matrimonials, matrimony, matrimony services, online Thane matrimonials, Indian marriage, match making, matchmaker, Thane profiles, marriage bureau , Thane marriage bureau, matchmaking services, matrimonial profiles, Thane bride, Thane groom, matrimony classified, brides, grooms', 'Thane Matrimonials', 'Y', 'thane-matrimonials.jpg', 'Thane Matrimony');
