INSERT INTO `COMMUNITY_PAGES` VALUES (148, 'India', '', 'COUNTRY', '51', 1, '/matrimonials/india-matrimonial/', 'Y', 'L1_CO_148', 'India is a vibrant country with diverse cultures living together in harmony. Every state in India has its own unique culture, customs and dressing style. Similarly, Indian weddings are diverse and very colorful where every religion celebrates their weddings with traditional rituals mixed with a lot of fun. The bride and the groom on their wedding day wear traditional clothes which have beautiful colorful Indian embroidery and Zari work compiled with heavy Indian gold and Kundan jewelry. ', 'India Matrimony - India Matrimonial - India Matrimonials - Indian Matrimony - Indian Matrimonials - India Marriage - Online India Matrimonials - Matrimonial Services', 'Search India Matrimony, India Matrimonial, India Matrimonials, Indian Matrimony, Indian Matrimonials, India Marriage, India Matrimonial Profiles in the leading India Matrimonials site for Indian and NRI India Marriage. Join Free &amp; Add your India Matrimonial Profile Now! Find suitable Indian &amp; NRI India brides and grooms from our online India matrimonial and matchmaking services.', 'India matrimony, India matrimonials, India matrimonial, matrimonials, matrimony, matrimony services, online India matrimonials, Indian marriage, match making, matchmaker, India profiles, marriage bureau , India marriage bureau, matchmaking services, matrimonial profiles, India bride, India groom, matrimony classified, brides, grooms', 'India Matrimonials', 'Y', 'india-matrimonials.jpg', 'India Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (149, 'United States', '', 'COUNTRY', '128', 1, '/matrimonials/usa-matrimonial/', 'Y', 'L1_CO_149', 'United States, situated in North America is one of the world&#039;s most ethnically diverse and multicultural nations. U.S. economy is the largest national economy in the world and is a secular nation. Almost 60% of Americans get married as soon as they cross the age of 18. Its population includes nearly 5 million people with American Indian ancestry. Even as Indian NRIs live in U.S., they prefer Indian girls when it comes to marriage. Inter-racial and inter-cultural matrimonies are also common.', 'U.S NRI Matrimony - U.S NRI Matrimonial - U.S NRI Matrimonials -U.S NRI Marriage - Online U.S NRI Matrimonials - Matrimonial Services', 'Search U.S NRI Matrimony, U.S NRI Matrimonial, U.S NRI Matrimonials, U.S NRI Marriage, U.S NRI Matrimonial Profiles in the leading U.S NRI Matrimonials site for Indian and NRI U.S NRI Marriage. Join Free &amp; Add your U.S NRI Matrimonial Profile Now! Find suitable Indian &amp; NRI U.S NRI brides and grooms from our online U.S NRI matrimonial and matchmaking services.', 'United States matrimony, United States matrimonials, United States matrimonial, matrimonials, matrimony, matrimony services, online United States matrimonials, Indian marriage, match making, matchmaker, United States profiles, marriage bureau , United States marriage bureau, matchmaking services, matrimonial profiles, United States bride, United States groom, matrimony classified, brides, grooms', 'USA Matrimonials', 'Y', 'usa-matrimonials.jpg', 'USA Matrimony');
