INSERT INTO `COMMUNITY_PAGES` VALUES (151, 'United Kingdom', '', 'COUNTRY', '126', 1, '/matrimonials/uk-matrimonial/', 'Y', 'L1_CO_151', 'United Kingdom is one of the most developed nations in Europe that consist of multi-ethnic people migrated from various countries. U.K has constitutional monarchy and has a partial free market economy. U.K has some of the best educational institutes in the world that includes Oxford University, Cambridge University and so on. A large number of Indians live in U.K and have kept their cultural beliefs intact. Indians largely marry within their community and spend lavishly on their weddings.', 'U.K NRI Matrimony - U.K NRI Matrimonial - U.K NRI Matrimonials -U.K NRI Marriage - Online U.K NRI Matrimonials - Matrimonial Services', 'Search U.K NRI Matrimony, U.K NRI Matrimonial, U.K NRI Matrimonials, U.K NRI Marriage, U.K NRI Matrimonial Profiles in the leading U.K NRI Matrimonials site for Indian and NRI U.K NRI Marriage. Join Free &amp; Add your U.K NRI Matrimonial Profile Now! Find suitable Indian &amp; NRI U.K NRI brides and grooms from our online U.K NRI matrimonial and matchmaking services.', 'UK matrimony, UK matrimonials, UK matrimonial, matrimonials, matrimony, matrimony services, online UK matrimonials, Indian marriage, match making, matchmaker, UK profiles, marriage bureau , UK marriage bureau, matchmaking services, matrimonial profiles, UK bride, UK groom, matrimony classified, brides, grooms', 'UK Matrimonials', 'Y', 'uk-matrimonials.jpg', 'UK Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (152, 'Australia', '', 'COUNTRY', '7', 1, '/australia-matrimony-matrimonials', 'Y', 'L1_CO_152', 'Australia in Southern Hemisphere is a prosperous country being the thirteenth largest economy in the world. Surrounded by Indian and Pacific Ocean, it is the smallest continent of the world also referred to as the â€˜Island Continentâ€™. Australia has no official language or religion but English is spoken by the majority and Christianity followed by about 65% of the population. With a diverse demographic profile comprising English, Irish, Scottish, Italian, etc., the marriage rituals vary largely.', 'Australia NRI Matrimony - Australia NRI Matrimonial - Australia NRI Matrimonials -Australia NRI Marriage - Online Australia NRI Matrimonials - Matrimonial Services', 'Search Australia NRI Matrimony, Australia NRI Matrimonial, Australia NRI Matrimonials, Australia NRI Marriage, Australia NRI Matrimonial Profiles in the leading Australia NRI Matrimonials site for Indian and NRI Australia NRI Marriage. Join Free &amp; Add your Australia NRI Matrimonial Profile Now! Find suitable Indian &amp; NRI Australia NRI brides and grooms from our online Australia NRI matrimonial and matchmaking services.', 'Australia matrimony, Australia matrimonials, Australia matrimonial, matrimonials, matrimony, matrimony services, online Australia matrimonials, Indian marriage, match making, matchmaker, Australia profiles, marriage bureau , Australia marriage bureau, matchmaking services, matrimonial profiles, Australia bride, Australia groom, matrimony classified, brides, grooms', 'Australia Matrimonials', 'Y', 'australia-matrimonials.jpg', 'Australia Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (153, 'Canada', '', 'COUNTRY', '22', 1, '/matrimonials/canada-matrimonial/', 'Y', 'L1_CO_153', 'Canada, the second largest country of the world, is very famous among the north Indians as a job destination. Candians basically follow British and French culture, but are highly influenced by the Indian culture. A significant number of Punjabi populations can be seen in the Canada, due to which Punjabi traditions and rituals are highly prevalent in Canada. Due to the presence of people from different backgrounds, Canada witness different cultures and customs being practised in the marriages. ', 'Canada NRI Matrimony - Canada NRI Matrimonial - Canada NRI Matrimonials -Canada NRI Marriage - Online Canada NRI Matrimonials - Matrimonial Services', 'Search Canada NRI Matrimony, Canada NRI Matrimonial, Canada NRI Matrimonials, Canada NRI Marriage, Canada NRI Matrimonial Profiles in the leading Canada NRI Matrimonials site for Indian and NRI Canada NRI Marriage. Join Free &amp; Add your Canada NRI Matrimonial Profile Now! Find suitable Indian &amp; NRI Canada NRI brides and grooms from our online Canada NRI matrimonial and matchmaking services.', 'Canada matrimony, Canada matrimonials, Canada matrimonial, matrimonials, matrimony, matrimony services, online Canada matrimonials, Indian marriage, match making, matchmaker, Canada profiles, marriage bureau , Canada marriage bureau, matchmaking services, matrimonial profiles, Canada bride, Canada groom, matrimony classified, brides, grooms', 'Canada Matrimonials', 'Y', 'canada-matrimonials.jpg', 'Canada Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (154, 'Pakistan', '', 'COUNTRY', '88', 1, '/matrimonials/pakistan-matrimonial/', 'Y', 'L1_CO_154', 'Pakistan is an Islamic nation having high regards for Muslim traditions. It has a rich culture where majority of the Muslims belong to Shia sect. People celebrate festivals and wedding occasions with lot of zeal. Islamic wedding are popularly known as â€˜Nikahâ€™ which in Urdu means a civil contract between a man and a woman to spend their life together with societyâ€™s consent and beget children. Islamic weddings go through number of celebrations such as Manjha ceremony, Sangeet ceremony and so on.', 'Pakistan Matrimony - Pakistan Matrimonial - Pakistan Matrimonials -Pakistan Marriage - Online Pakistan Matrimonials - Matrimonial Services', 'Search Pakistan Matrimony, Pakistan Matrimonial, Pakistan Matrimonials, Pakistan Marriage, Pakistan Matrimonial Profiles in the leading Pakistan Matrimonials site for Indian and NRI Pakistan Marriage. Join Free &amp; Add your Pakistan Matrimonial Profile Now! Find suitable Indian &amp; NRI Pakistan brides and grooms from our online Pakistan matrimonial and matchmaking services.', 'Pakistan matrimony, Pakistan matrimonials, Pakistan matrimonial, matrimonials, matrimony, matrimony services, online Pakistan matrimonials, Indian marriage, match making, matchmaker, Pakistan profiles, marriage bureau , Pakistan marriage bureau, matchmaking services, matrimonial profiles, Pakistan bride, Pakistan groom, matrimony classified, brides, grooms', 'Pakistan Matrimonials', 'Y', 'pakistan-matrimonials.jpg', 'Pakistan Matrimony');
