INSERT INTO `COMMUNITY_PAGES` VALUES (164, 'Maharashtra', '', 'STATE', 'MH', 1, '/matrimonials/maharashtra-matrimonial/', 'Y', 'L1_ST_164', 'Maharashtra is a western state in India comprised of many cultures. Marathi is the official language of Maharashtra and Marathi is the dominant caste of this region. People in Maharashtra are very simple and this is reflected in their weddings as well. A Marathi wedding is a simple social gathering with no pomp and show. The bride and the groom solemnize their wedding by performing rituals and look beautiful in their wedding attires which are saree for the bride and kurta pyjama for the groom. ', 'Maharashtra Matrimony - Maharashtra Matrimonial - Maharashtra Matrimonials - Maharashtra Marriage - Online Maharashtra Matrimonials - Matrimonial Services', 'Search Maharashtra Matrimony, Maharashtra Matrimonial, Maharashtra Matrimonials, Maharashtra Marriage, Maharashtra Matrimonial Profiles in the leading Maharashtra Matrimonials site for Indian and NRI Maharashtra Marriage. Join Free &amp; Add your Maharashtra Matrimonial Profile Now! Find suitable Indian &amp; NRI Maharashtra brides and grooms from our online Maharashtra matrimonial and matchmaking services.', 'Maharashtra matrimony, Maharashtra matrimonials, Maharashtra matrimonial, matrimonials, matrimony, matrimony services, online Maharashtra matrimonials, Indian marriage, match making, matchmaker, Maharashtra profiles, marriage bureau , Maharashtra marriage bureau, matchmaking services, matrimonial profiles, Maharashtra bride, Maharashtra groom, matrimony classified, brides, grooms', 'Maharashtra Matrimonials', 'Y', 'maharashtra-matrimonials.jpg', 'Maharashtra Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (165, 'Delhi', '', 'STATE', 'DE', 1, '/matrimonials/delhi-matrimonials/', 'N', 'L1_ST_165', 'Delhi, the largest metropolis by area in India has a population of around 35 million including NCR (National Capital Region). NCR has cities like Gurgaon, Noida, Ghaziabad, Greater Noida and Faridabad which are the emerging commercial centers. The main languages spoken in the city include Hindi, English, Punjabi and Urdu. This cosmopolitan city is a political and economic hub of North India being the national capital. Marriages in Delhi are widely popular for being flamboyant and traditional. ', 'Delhi Matrimony - Delhi Matrimonial - Delhi Matrimonials -Delhi Marriage - Online Delhi Matrimonials - Matrimonial Services', 'Search Delhi Matrimony, Delhi Matrimonial, Delhi Matrimonials, Delhi Marriage, Delhi Matrimonial Profiles in the leading Delhi Matrimonials site for Indian and NRI Delhi Marriage. Join Free &amp; Add your Delhi Matrimonial Profile Now! Find suitable Indian &amp; NRI Delhi brides and grooms from our online Delhi matrimonial and matchmaking services.', 'Delhi matrimony, Delhi matrimonials, Delhi matrimonial, matrimonials, matrimony, matrimony services, online Delhi matrimonials, Indian marriage, match making, matchmaker, Delhi profiles, marriage bureau , Delhi marriage bureau, matchmaking services, matrimonial profiles, Delhi bride, Delhi groom, matrimony classified, brides, grooms', 'Delhi Matrimonials', 'Y', 'delhi-matrimonials.jpg', 'delhi matrimony');
