INSERT INTO `COMMUNITY_PAGES` VALUES (167, 'Uttar Pradesh', '', 'STATE', 'UP', 1, '/matrimonials/uttar-pradesh-matrimonial/', 'Y', 'L1_ST_167', 'Uttar Pradesh is a multi-cultural city inhabiting people from various religions. It is the second largest state economy in India comprising of cities like Noida, Luckhnow, Agra, Kanpur and other industrial cities. The people living in Uttar Pradesh celebrate various festivals among which marriages are the most celebrated occasions. The bride and the groom are bestowed with numerous gifts by the guests that attend the grand weddings organized in large farm houses and banquet halls. ', 'Uttar Pradesh Matrimony - Uttar Pradesh Matrimonial - Uttar Pradesh Matrimonials -UP Matrimony - UP Matrimonials - Uttar Pradesh Marriage - Online Uttar Pradesh Matrimonials - Matrimonial Services', 'Search Uttar Pradesh Matrimony, Uttar Pradesh Matrimonial, Uttar Pradesh Matrimonials, UP Matrimony, UP Matrimonials, Uttar Pradesh Marriage, Uttar Pradesh Matrimonial Profiles in the leading Uttar Pradesh Matrimonials site for Indian and NRI Uttar Pradesh Marriage. Join Free &amp; Add your Uttar Pradesh Matrimonial Profile Now! Find suitable Indian &amp; NRI Uttar Pradesh brides and grooms from our online Uttar Pradesh matrimonial and matchmaking services.', 'Uttar Pradesh matrimony, Uttar Pradesh matrimonials, Uttar Pradesh matrimonial, matrimonials, matrimony, matrimony services, online Uttar Pradesh matrimonials, Indian marriage, match making, matchmaker, Uttar Pradesh profiles, marriage bureau , Uttar Pradesh marriage bureau, matchmaking services, matrimonial profiles, Uttar Pradesh bride, Uttar Pradesh groom, matrimony classified, brides, grooms', 'Uttar Pradesh Matrimonials', 'Y', 'uttar-pradesh-matrimonials.jpg', 'Uttar Pradesh Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (168, 'Karnataka', '', 'STATE', 'KA', 1, '/matrimonials/karnataka-matrimonial/', 'Y', 'L1_ST_168', 'Karnataka in South West India is not only a manufacturing hub but also an IT and biotechnology center. It has a huge silk industry. With hugely diverse linguistic and religious ethnicities, it holds a special place in the world of Indian classical music. Kannada is the official language of the state while Urdu is also spoken by the Muslim population. Marriages among Kannadigas (Kannada speaking people) are joyfully simple as different communities in the state follow different wedding rituals. ', 'Karnataka Matrimony - Karnataka Matrimonial - Karnataka Matrimonials -Karnataka Marriage - Online Karnataka Matrimonials - Matrimonial Services', 'Search Karnataka Matrimony, Karnataka Matrimonial, Karnataka Matrimonials, Karnataka Marriage, Karnataka Matrimonial Profiles in the leading Karnataka Matrimonials site for Indian and NRI Karnataka Marriage. Join Free &amp; Add your Karnataka Matrimonial Profile Now! Find suitable Indian &amp; NRI Karnataka brides and grooms from our online Karnataka matrimonial and matchmaking services.', 'Karnataka matrimony, Karnataka matrimonials, Karnataka matrimonial, matrimonials, matrimony, matrimony services, online Karnataka matrimonials, Indian marriage, match making, matchmaker, Karnataka profiles, marriage bureau , Karnataka marriage bureau, matchmaking services, matrimonial profiles, Karnataka bride, Karnataka groom, matrimony classified, brides, grooms', 'Karnataka Matrimonials', 'Y', 'karnataka-matrimonials.jpg', 'Karnataka Matrimony');
