INSERT INTO `COMMUNITY_PAGES` VALUES (171, 'West Bengal', '', 'STATE', 'WB', 1, '/matrimonials/west-bengal-matrimonials/', 'Y', 'L1_ST_171', 'West Bengal in East India is the third largest contributor to Indiaâ€™s GDP. The official language of the state is Bengali and English even as Hindi, Urdu and Nepali are also commonly spoken. With nearly 73% Hindus and more than 25% Muslims, Hinduism and Islam are the main religions. \n\nMarriages in West Bengal among both Hindu and Muslim communities are arranged by Ghotoks or matchmakers. There are various pre-wedding, wedding and post wedding rituals or customs followed in Bengali matrimonies. \n', 'West Bengal Matrimony - West Bengal Matrimonial - West Bengal Matrimonials -West Bengal Marriage - Online West Bengal Matrimonials - Matrimonial Services', 'Search West Bengal Matrimony, West Bengal Matrimonial, West Bengal Matrimonials, West Bengal Marriage, West Bengal Matrimonial Profiles in the leading West Bengal Matrimonials site for Indian and NRI West Bengal Marriage. Join Free &amp; Add your West Bengal Matrimonial Profile Now! Find suitable Indian &amp; NRI West Bengal brides and grooms from our online West Bengal matrimonial and matchmaking services.', 'West Bengal matrimony, West Bengal matrimonials, West Bengal matrimonial, matrimonials, matrimony, matrimony services, online West Bengal matrimonials, Indian marriage, match making, matchmaker, West Bengal profiles, marriage bureau , West Bengal marriage bureau, matchmaking services, matrimonial profiles, West Bengal bride, West Bengal groom, matrimony classified, brides, grooms', 'West Bengal Matrimonials', 'Y', 'west-bengal-matrimonials.jpg', 'West Bengal Matrimony');
