INSERT INTO `COMMUNITY_PAGES` VALUES (173, 'Gujarat', '', 'STATE', 'GU', 1, '/matrimonials/gujarat-matrimonial/', 'Y', 'L1_ST_173', 'Gujarat is a state located in the western region of India. It is the birth place of M.K Gandhi, the father of the nation. People in Gujarat speak Gujarati and the maximum population is inhabited by Hindus. The festivities among Gujaratiâ€™s are marked by plethora of colors with lots of fun everywhere. The marriages in Gujarat are a royal affair where the bride and groom look princely in their wedding attires. The weddings are lavish comprising of grand decorations with sumptuous cuisines.', 'Gujarat Matrimony - Gujarat Matrimonial - Gujarat Matrimonials -Gujarat Marriage - Online Gujarat Matrimonials - Matrimonial Services', 'Search Gujarat Matrimony, Gujarat Matrimonial, Gujarat Matrimonials, Gujarat Marriage, Gujarat Matrimonial Profiles in the leading Gujarat Matrimonials site for Indian and NRI Gujarat Marriage. Join Free &amp; Add your Gujarat Matrimonial Profile Now! Find suitable Indian &amp; NRI Gujarat brides and grooms from our online Gujarat matrimonial and matchmaking services.', 'Gujarat matrimony, Gujarat matrimonials, Gujarat matrimonial, matrimonials, matrimony, matrimony services, online Gujarat matrimonials, Indian marriage, match making, matchmaker, Gujarat profiles, marriage bureau , Gujarat marriage bureau, matchmaking services, matrimonial profiles, Gujarat bride, Gujarat groom, matrimony classified, brides, grooms', 'Gujarat Matrimonials', 'Y', 'gujarat-matrimonials.jpg', 'Gujarat Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (174, 'Haryana', '', 'STATE', 'HA', 1, '/matrimonials/haryana-matrimonial/', 'Y', 'L1_ST_174', 'Haryana is one of the wealthiest states in India and among the most economically developed regions in South Asia. Major ethnic group in Haryana is of Jat people and Hindus are in majority making for about 90% of the population. It has a rich cultural heritage and a wealth of folk dances which are usually performed at marriages, births, festivals and harvest times. An all-female Haryanvi dance called Khoria dance is performed during the long wait for the bridegroom to bring his new bride home. ', 'Haryana Matrimony - Haryana Matrimonial - Haryana Matrimonials -Haryana Marriage - Online Haryana Matrimonials - Matrimonial Services', 'Search Haryana Matrimony, Haryana Matrimonial, Haryana Matrimonials, Haryana Marriage, Haryana Matrimonial Profiles in the leading Haryana Matrimonials site for Indian and NRI Haryana Marriage. Join Free &amp; Add your Haryana Matrimonial Profile Now! Find suitable Indian &amp; NRI Haryana brides and grooms from our online Haryana matrimonial and matchmaking services.', 'Haryana matrimony, Haryana matrimonials, Haryana matrimonial, matrimonials, matrimony, matrimony services, online Haryana matrimonials, Indian marriage, match making, matchmaker, Haryana profiles, marriage bureau , Haryana marriage bureau, matchmaking services, matrimonial profiles, Haryana bride, Haryana groom, matrimony classified, brides, grooms', 'Haryana Matrimonials', 'Y', 'haryana-matrimonials.jpg', 'Haryana Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (175, 'Bihar', '', 'STATE', 'BI', 1, '/bihar-matrimony-matrimonials', 'Y', 'L1_ST_175', 'Bihar is the one of the developing states of India, whose capital is Patna. The official languages of Bihar, are, Hindi and Urdu, while a large number of people in Bihar speak any one of the languages like, Angika, Bajjika, Bhojpuri and Maithili, also known as Bihari languages. Agriculture and farming are the major occupations practised by Biharis, from which they earn their living. Marriages in Bihar mainly occur between the people of same caste and community, celebrated at a large scale.  ', 'Bihar Matrimony - Bihar Matrimonial - Bihar Matrimonials -Bihar Marriage - Online Bihar Matrimonials - Matrimonial Services', 'Search Bihar Matrimony, Bihar Matrimonial, Bihar Matrimonials, Bihar Marriage, Bihar Matrimonial Profiles in the leading Bihar Matrimonials site for Indian and NRI Bihar Marriage. Join Free &amp; Add your Bihar Matrimonial Profile Now! Find suitable Indian &amp; NRI Bihar brides and grooms from our online Bihar matrimonial and matchmaking services.', 'Bihar matrimony, Bihar matrimonials, Bihar matrimonial, matrimonials, matrimony, matrimony services, online Bihar matrimonials, Indian marriage, match making, matchmaker, Bihar profiles, marriage bureau , Bihar marriage bureau, matchmaking services, matrimonial profiles, Bihar bride, Bihar groom, matrimony classified, brides, grooms', 'Bihar Matrimonials', 'Y', 'bihar-matrimonials.jpg', 'Bihar Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (176, 'Kerala', '', 'STATE', 'KE', 1, '/matrimonials/kerala-matrimonial/', 'Y', 'L1_ST_176', 'Kerala is a beautiful state famous for its backwaters and Ayurvedic treatment is located in the south-western region of India. Keraliteâ€™s are mostly employed in healthcare services and in agriculture. Malayalam is the most spoken language in the city as majority of the people belongs to Malayalee caste. Malayalee weddings are very different from other Hindu weddings as the celebrations are commenced in the afternoon. The bride wears a saree (Mundu) and the groom wears dhoti and angavastram.', 'Kerala Matrimony - Kerala Matrimonial - Kerala Matrimonials -Kerala Marriage - Online Kerala Matrimonials - Matrimonial Services', 'Search Kerala Matrimony, Kerala Matrimonial, Kerala Matrimonials, Kerala Marriage, Kerala Matrimonial Profiles in the leading Kerala Matrimonials site for Indian and NRI Kerala Marriage. Join Free &amp; Add your Kerala Matrimonial Profile Now! Find suitable Indian &amp; NRI Kerala brides and grooms from our online Kerala matrimonial and matchmaking services.', 'Kerala matrimony, Kerala matrimonials, Kerala matrimonial, matrimonials, matrimony, matrimony services, online Kerala matrimonials, Indian marriage, match making, matchmaker, Kerala profiles, marriage bureau , Kerala marriage bureau, matchmaking services, matrimonial profiles, Kerala bride, Kerala groom, matrimony classified, brides, grooms', 'Kerala Matrimonials', 'Y', 'kerala-matrimonials.jpg', 'Kerala Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (177, 'Rajasthan', '', 'STATE', 'RA', 1, '/rajasthan-matrimony-matrimonials', 'Y', 'L1_ST_177', 'Rajasthan is immensely popular as a tourist hub being one of the most beautiful and culturally rich states of India. It is the largest state of the country by area and has a fascinating folk culture along with various architectural marvels attracting people from around the world. \nRajasthan is also a highly favored wedding destination known for its heritage hotels, forts and palaces, pilgrimage centers, handicrafts and other such things. This &#039;Land of Maharajas&#039; is ideal for dream marriages.', 'Rajasthan Matrimony - Rajasthan Matrimonial - Rajasthan Matrimonials -Rajasthan Marriage - Online Rajasthan Matrimonials - Matrimonial Services', 'Search Rajasthan Matrimony, Rajasthan Matrimonial, Rajasthan Matrimonials, Rajasthan Marriage, Rajasthan Matrimonial Profiles in the leading Rajasthan Matrimonials site for Indian and NRI Rajasthan Marriage. Join Free &amp; Add your Rajasthan Matrimonial Profile Now! Find suitable Indian &amp; NRI Rajasthan brides and grooms from our online Rajasthan matrimonial and matchmaking services.', 'Rajasthan matrimony, Rajasthan matrimonials, Rajasthan matrimonial, matrimonials, matrimony, matrimony services, online Rajasthan matrimonials, Indian marriage, match making, matchmaker, Rajasthan profiles, marriage bureau , Rajasthan marriage bureau, matchmaking services, matrimonial profiles, Rajasthan bride, Rajasthan groom, matrimony classified, brides, grooms', 'Rajasthan Matrimonials', 'Y', 'rajasthan-matrimonials.jpg', 'Rajasthan Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (178, 'Punjab', '', 'STATE', 'PU', 1, '/punjab-matrimony-matrimonials', 'Y', 'L1_ST_178', 'Punjab, the land of five rivers is home to most of the north Indian Punjabis. Punjabi people portray the cultural and the religious beauty of India. Punjabi and Hindi are their main languages and a large number of Sikhs and Punjabi Hindus can be found in different parts of the state. Marriage is always an extravagant affair in Punjabis and they search for highly cultured, well educated and well- settled Punjabi life partner for their children. Inter- caste marriages happen, but less in number. ', 'Punjab Matrimony - Punjab Matrimonial - Punjab Matrimonials -Punjab Marriage - Online Punjab Matrimonials - Matrimonial Services', 'Search Punjab Matrimony, Punjab Matrimonial, Punjab Matrimonials, Punjab Marriage, Punjab Matrimonial Profiles in the leading Punjab Matrimonials site for Indian and NRI Punjab Marriage. Join Free &amp; Add your Punjab Matrimonial Profile Now! Find suitable Indian &amp; NRI Punjab brides and grooms from our online Punjab matrimonial and matchmaking services.', 'Punjab matrimony, Punjab matrimonials, Punjab matrimonial, matrimonials, matrimony, matrimony services, online Punjab matrimonials, Indian marriage, match making, matchmaker, Punjab profiles, marriage bureau , Punjab marriage bureau, matchmaking services, matrimonial profiles, Punjab bride, Punjab groom, matrimony classified, brides, grooms', 'Punjab Matrimonials', 'Y', 'punjab-matrimonials.jpg', 'Punjab Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (179, 'Orissa', '', 'STATE', 'OR', 1, '/matrimonials/orissa-matrimonial/', 'Y', 'L1_ST_179', 'Orissa is an Indian state located on the east coast of India by the Bay of Bengal. The state is famous for its natural resources like Coal, Bauxite and iron ore which has made it an industrial state. Oriya is the official language of Orissa and is widely spoken by its people. In Orissa people lead a very simple lifestyle which gets reflected in their marriages as well. The marriages are conducted either in a temple or in Brideâ€™s house. There is no grandiosity and flamboyancy in their weddings. ', 'Orissa Matrimony - Orissa Matrimonial - Orissa Matrimonials -Orissa Marriage - Online Orissa Matrimonials - Matrimonial Services', 'Search Orissa Matrimony, Orissa Matrimonial, Orissa Matrimonials, Orissa Marriage, Orissa Matrimonial Profiles in the leading Orissa Matrimonials site for Indian and NRI Orissa Marriage. Join Free &amp; Add your Orissa Matrimonial Profile Now! Find suitable Indian &amp; NRI Orissa brides and grooms from our online Orissa matrimonial and matchmaking services.', 'Orissa matrimony, Orissa matrimonials, Orissa matrimonial, matrimonials, matrimony, matrimony services, online Orissa matrimonials, Indian marriage, match making, matchmaker, Orissa profiles, marriage bureau , Orissa marriage bureau, matchmaking services, matrimonial profiles, Orissa bride, Orissa groom, matrimony classified, brides, grooms', 'Orissa Matrimonials', 'Y', 'orissa-matrimonials.jpg', 'Orissa Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (180, 'Chandighar', '', 'STATE', 'CH', 1, '/matrimonials/chandigarh-matrimonial/', 'N', 'L1_ST_180', 'Chandigarh serving as the capital of two states is the first planned city in India. Its culture is an amalgamation of the traditions of its neighboring states but is heavily influenced by Punjabi practices.  North Indian food is extremely popular in the city. \r\n\r\nWeddings in Chandigarh are a lavish affair with plethora of options in the food and drinks menu. The exceptional fusion of east and west as well as tradition and modernity make marriages in Chandigarh a memorable and delightful experience. \r\n', 'Chandigarh Matrimony - Chandigarh Matrimonial - Chandigarh Matrimonials -Chandigarh Marriage - Online Chandigarh Matrimonials - Matrimonial Services', 'Search Chandigarh Matrimony, Chandigarh Matrimonial, Chandigarh Matrimonials, Chandigarh Marriage, Chandigarh Matrimonial Profiles in the leading Chandigarh Matrimonials site for Indian and NRI Chandigarh Marriage. Join Free &amp; Add your Chandigarh Matrimonial Profile Now! Find suitable Indian &amp; NRI Chandigarh brides and grooms from our online Chandigarh matrimonial and matchmaking services.', 'Chandigarh matrimony, Chandigarh matrimonials, Chandigarh matrimonial, matrimonials, matrimony, matrimony services, online Chandigarh matrimonials, Indian marriage, match making, matchmaker, Chandigarh profiles, marriage bureau , Chandigarh marriage bureau, matchmaking services, matrimonial profiles, Chandigarh bride, Chandigarh groom, matrimony classified, brides, grooms', 'Chandigarh Matrimonials', 'Y', 'chandigarh-matrimonials.jpg', 'chandigarh matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (181, 'Assam', '', 'STATE', 'AS', 1, '/matrimonials/assam-matrimonial/', 'Y', 'L1_ST_181', 'Assam, the land of high rainfall, located in Himalayas, is blessed with lush greenery and dazzling water adding to its aesthetic beauty. People of Assam are known as Assamese and majority of them are the followers of Hindu and Islamic religion. The marriage rituals and customs in Assam, remain the same in accordance to the respective religion, with the addition of the Assamese culture. Assamese are mainly involved in the agricultural business, which is largely of the production of tea leaves.  ', 'Assam Matrimony - Assam Matrimonial - Assam Matrimonials -Assam Marriage - Online Assam Matrimonials - Matrimonial Services', 'Search Assam Matrimony, Assam Matrimonial, Assam Matrimonials, Assam Marriage, Assam Matrimonial Profiles in the leading Assam Matrimonials site for Indian and NRI Assam Marriage. Join Free &amp; Add your Assam Matrimonial Profile Now! Find suitable Indian &amp; NRI Assam brides and grooms from our online Assam matrimonial and matchmaking services.', 'Assam matrimony, Assam matrimonials, Assam matrimonial, matrimonials, matrimony, matrimony services, online Assam matrimonials, Indian marriage, match making, matchmaker, Assam profiles, marriage bureau , Assam marriage bureau, matchmaking services, matrimonial profiles, Assam bride, Assam groom, matrimony classified, brides, grooms', 'Assam Matrimonials', 'Y', 'assam-matrimonials.jpg', 'Assam Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (182, 'Jammu & Kashmir', '', 'STATE', 'JK', 1, '/matrimonials/jammu-kashmir-matrimonial/', 'Y', 'L1_ST_182', 'Jammu and Kashmir is the northern most state in India and is known for its scenic beauty and often stated as the paradise on earth. The main occupation and source of income of Kashmiri people is through agriculture and tourism sector. Muslims constitute the largest population in the region followed by Hindus followed by Budhhists. One must attend a Kashmiri wedding in his/her lifetime as some of the rituals and dresses are very unique and different from other Indian marriages. ', 'Jammu &amp; Kashmir Matrimony - Jammu &amp; Kashmir Matrimonial - Jammu &amp; Kashmir Matrimonials -Jammu &amp; Kashmir Marriage - Online Jammu &amp; Kashmir Matrimonials - Matrimonial Services', 'Search Jammu &amp; Kashmir Matrimony, Jammu &amp; Kashmir Matrimonial, Jammu &amp; Kashmir Matrimonials, Jammu &amp; Kashmir Marriage, Jammu &amp; Kashmir Matrimonial Profiles in the leading Jammu &amp; Kashmir Matrimonials site for Indian and NRI Jammu &amp; Kashmir Marriage. Join Free &amp; Add your Jammu &amp; Kashmir Matrimonial Profile Now! Find suitable Indian &amp; NRI Jammu &amp; Kashmir brides and grooms from our online Jammu &amp; Kashmir matrimonial and matchmaking services.', 'Jammu &amp; Kashmir matrimony, Jammu &amp; Kashmir matrimonials, Jammu &amp; Kashmir matrimonial, matrimonials, matrimony, matrimony services, online Jammu &amp; Kashmir matrimonials, Indian marriage, match making, matchmaker, Jammu &amp; Kashmir profiles, marriage bureau , Jammu &amp; Kashmir marriage bureau, matchmaking services, matrimonial profiles, Jammu &amp; Kashmir bride, Jammu &amp; Kashmir groom, matrimony classified, brides, grooms', 'Jammu &amp; Kashmir Matrimonials', 'Y', 'jammu-kashmir-matrimonials.jpg', 'Jammu Kashmir Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (183, 'Goa', '', 'STATE', 'GO', 1, '/matrimonials/goa-matrimonials/', 'N', 'L1_ST_183', 'Goa is considered to be one of the most romantic places in India with its pristine beaches and long swaying palm fringed settings. It is one of the most preferred wedding destinations as couples wish to tie the nuptial knot against the backdrop of rushing waves with the moist sea breeze flowing calmly. Goa offers mesmerizing ambience for weddings as two individuals come together through the blissful bond of marriage. Beach weddings in Goa are fast gaining momentum amongst young urban couples.', 'Goa Matrimony - Goa Matrimonial - Goa Matrimonials -Goa Marriage - Online Goa Matrimonials - Matrimonial Services', 'Search Goa Matrimony, Goa Matrimonial, Goa Matrimonials, Goa Marriage, Goa Matrimonial Profiles in the leading Goa Matrimonials site for Indian and NRI Goa Marriage. Join Free &amp; Add your Goa Matrimonial Profile Now! Find suitable Indian &amp; NRI Goa brides and grooms from our online Goa matrimonial and matchmaking services.', 'Goa matrimony, Goa matrimonials, Goa matrimonial, matrimonials, matrimony, matrimony services, online Goa matrimonials, Indian marriage, match making, matchmaker, Goa profiles, marriage bureau , Goa marriage bureau, matchmaking services, matrimonial profiles, Goa bride, Goa groom, matrimony classified, brides, grooms', 'Goa Matrimonials', 'Y', 'goa-matrimonials.jpg', 'Goa Matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (184, 'Himachal Pradesh', '', 'STATE', 'HP', 1, '/matrimonials/himachal-pradesh-matrimonial/', 'Y', 'L1_ST_184', 'Himachal Pradesh, the region surrounded by snowy mountains all round, is also known as the land of Gods. The people of Himachal are generally called Himachalis and the languages spoken by them are collectively known as Pihari languages. Hydro electric power, tourism and agriculture are the three sources of income for the people of Himachal. Marriages in Himachal, are usually simple and majority of Hindu marriages can be witnessed, because of the maximum concentration of Hindus in the state.   ', 'Himachal Pradesh Matrimony - Himachal Pradesh Matrimonial - Himachal Pradesh Matrimonials -Himachal Pradesh Marriage - Online Himachal Pradesh Matrimonials - Matrimonial Services', 'Search Himachal Pradesh Matrimony, Himachal Pradesh Matrimonial, Himachal Pradesh Matrimonials, Himachal Pradesh Marriage, Himachal Pradesh Matrimonial Profiles in the leading Himachal Pradesh Matrimonials site for Indian and NRI Himachal Pradesh Marriage. Join Free &amp; Add your Himachal Pradesh Matrimonial Profile Now! Find suitable Indian &amp; NRI Himachal Pradesh brides and grooms from our online Himachal Pradesh matrimonial and matchmaking services.', 'Himachal Pradesh matrimony, Himachal Pradesh matrimonials, Himachal Pradesh matrimonial, matrimonials, matrimony, matrimony services, online Himachal Pradesh matrimonials, Indian marriage, match making, matchmaker, Himachal Pradesh profiles, marriage bureau , Himachal Pradesh marriage bureau, matchmaking services, matrimonial profiles, Himachal Pradesh bride, Himachal Pradesh groom, matrimony classified, brides, grooms', 'Himachal Pradesh Matrimonials', 'Y', 'himachal-pradesh-matrimonials.jpg', 'Himachal Pradesh Matrimony');
