INSERT INTO `COMMUNITY_PAGES` VALUES (189, 'Divorcee', '', 'OTHERS', '', 1, '/divorcee-matrimony-matrimonials', 'N', 'L1_OT_189', 'Divorcees are those people that undergo a legal separation with their spouses before death. There can be various reasons for a divorce such as lack of compatibility, insecurity, lack of emotional and physical bonding and so on. The percentage of Divorcees in India is increasing with an alarming rate. More and more divorcee people of all age group are looking for a life partner for themselves on matrimonial sites with whom they can spend their rest of the life peacefully and enjoy married life.', 'Divorcee Matrimony - Divorcee Matrimonial - Divorcee Matrimonials - Divorcee Marriage - Online Divorced Matrimonials - Matrimonial Services', 'Search Divorcee Matrimony, Divorcee Matrimonial, Divorcee Matrimonials, Divorced Matrimony, Divorced Matrimonials, Divorcee Matrimonial Profiles in the leading Divorcee matrimonials site for Divorcee marriage. Join Free &amp; Add your Divorcee Matrimonial Profile Now! Find suitable Divorcee brides and grooms. Ready for Divorcee Marriage? Search Divorcee matrimonials, Divorcee matrimony profiles, Divorcee bride and groom from our online Divorcee matrimonial and matchmaking services', 'Divorcee matrimony, Divorcee matrimonials, Divorcee matrimonial, matrimonials, matrimony, matrimony services, online Divorcee matrimonials, Indian marriage, match making, matchmaker, Divorcee profiles, marriage bureau , Divorcee marriage bureau, matchmaking services, matrimonial profiles, Divorcee bride, Divorcee groom, matrimony classified, brides, grooms', 'Divorcee Matrimonials', 'N', 'divorcee-matrimonials.jpg', 'divorcee matrimony');
INSERT INTO `COMMUNITY_PAGES` VALUES (190, 'Widow and Widower', '', 'OTHERS', '', 1, '/widow-widower-matrimony-matrimonials', 'N', 'L1_OT_190', 'Widows and widowers tread a lonely path after the death of their spouse as life moves on. Remarrying has always been a debatable issue in India as widows and widowers await answers to many questions- how long to wait before remarrying; how should it be dealt with children along; etc. But the fact that filling a void left by the death of a life-partner is important cannot be denied. Ways of loving and getting into a marriage change as feeling of love matures and grandeur in weddings lessens.', 'Widow Matrimony - Widower Matrimony - Widow Matrimonial - Widower Matrimonials - Widower Matrimonials - Widow Marriage - Widower Marriage - Online Widow and Widower Matrimonials - Matrimonial Services', 'Search Widow Matrimony, Widower Matrimony, Widow Matrimonial, Widower Matrimonial, Widow Matrimonials, Widower Matrimonials, Widow Widower and Matrimonial Profiles in the leading matrimonials site. Join Free &amp; Add your Widow / Widower Matrimonial Profile Now! Find suitable Widow / Widower brides and grooms. Ready for Widow / Widower Marriage? Search Widow /Widower matrimony profiles, Widow / Widower bride and groom through our online Widow / Widower matchmaking services', 'Widow matrimony, Widower matrimonials, Widow matrimonial, matrimonials, widower matrimony, matrimony, matrimony services, Widow and Widower matrimonials, Indian marriage, match making, matchmaker, Widow and Widower profiles, marriage bureau , matchmaking services, matrimonial profiles, Widow bride, Widower groom, matrimony classified, brides, grooms', 'Widow and Widower Matrimonials', 'N', 'widow-widower-matrimonials.jpg', 'widow widower matrimony');
